import React from 'react';
import { Routes, Route, Navigate, Link, useNavigate, useLocation } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import CreateShipment from './components/CreateShipment';
import TrackShipment from './components/TrackShipment';
import DirectTrackShipment from './components/DirectTrackShipment';
import OtpVerification from './components/OtpVerification';

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  const userId = localStorage.getItem('userId');
  return userId ? children : <Navigate to="/login" replace />;
};

// Navigation Component
const Navigation = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const userId = localStorage.getItem('userId');
  const userName = localStorage.getItem('userName');

  const handleLogout = () => {
    localStorage.removeItem('userId');
    localStorage.removeItem('userEmail');
    localStorage.removeItem('userName');
    navigate('/login');
  };

  // Don't show navigation on login/register pages
  if (location.pathname === '/login' || location.pathname === '/register') {
    return null;
  }

  return (
    <nav className="navbar">
      <div className="container">
        <h1>Parcel Tracker</h1>
        <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
          <nav>
            <Link to="/track-shipment">Track Shipment</Link>
            {userId && (
              <>
                <Link to="/dashboard">Dashboard</Link>
                <Link to="/create-shipment">Create Shipment</Link>
              </>
            )}
            {!userId && (
              <>
                <Link to="/login">Login</Link>
                <Link to="/register">Register</Link>
              </>
            )}
          </nav>
          {userId && (
            <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
              <span>Welcome, {userName}!</span>
              <button className="logout-btn" onClick={handleLogout}>
                Logout
              </button>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
};

function App() {
  const userId = localStorage.getItem('userId');

  return (
    <div className="App">
      <Navigation />
      <div className="container">
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/track-shipment" element={<TrackShipment />} />
          <Route path="/track/:trackingId" element={<DirectTrackShipment />} />
          <Route 
            path="/dashboard" 
            element={
              <ProtectedRoute>
                <Dashboard />
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/create-shipment" 
            element={
              <ProtectedRoute>
                <CreateShipment />
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/otp-verification/:shipmentId" 
            element={
              <ProtectedRoute>
                <OtpVerification />
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/" 
            element={
              userId ? <Navigate to="/dashboard" replace /> : <Navigate to="/login" replace />
            } 
          />
          <Route 
            path="*" 
            element={
              userId ? <Navigate to="/dashboard" replace /> : <Navigate to="/login" replace />
            } 
          />
        </Routes>
      </div>
    </div>
  );
}

export default App;
